export const Question = [
    {
      question: 'What exactly is this?',
      answer: 'This is a ......'
    },
    {
      question: 'How do I make payment?',
      answer: 'You can make payments through several means all supported by the app. Paypal and the rest.'
    },
    {
      question: 'Is my data secured?',
      answer: "Yes. To ensure our customer's data are secure, we use end-to-end encryption."
    }
  ];
